import React from 'react';
import './styles/App.css'
import {useState} from "react";
import UsersList from "./components/usersList";
import MyButton from "./components/UI/button/MyButton";
import MyInput from "./components/UI/input/MyInput";


function Users() {

    const [users, setUsers] = useState([
        {id: 0, username: "Valera", testData: "01-01-21", speed: 200, accuracy: 99},
        {id: 1, username: "Valera", testData: "01-01-21", speed: 200, accuracy: 99},
        {id: 2, username: "Valera", testData: "01-01-21", speed: 200, accuracy: 99},
        {id: 3, username: "Valera", testData: "01-01-21", speed: 200, accuracy: 99},
    ]);


    return (
        <div className="App">
            <form>
                <MyInput type="text" placeholder="название"/>
                <MyInput type="text" placeholder="тема"/>
                <MyButton>Пройти Тестирование</MyButton>
            </form>
            <UsersList users={users} title={"Список участников"}/>
        </div>
    )};



export default Users;
